export const fetchData = async (field = null) => {
  if(field !== null) {
    console.log('1')
  } else {
    try {
      const response = await fetch("https://jsonplaceholder.typicode.com/posts");
      const data = await response.json();
      return data;
    } catch (e) {
      console.log(e);
    }
  }
};
